import {
  Byte,
  type ByteType,
  createGodactScene,
  createTileSet,
  Node2D,
  PackedArray,
  TileMapLayer,
} from "@inbestigator/godact";

function MainScene() {
  return (
    <Node2D name="MainScene">
      <TileMapLayer
        tile_set={createTileSet({
          path: "res://tile_set.tres",
        })}
        tile_map_data={PackedArray<ByteType>(
          Byte(
            "",
          ),
        )}
      />
    </Node2D>
  );
}

createGodactScene(<MainScene />, "./examples/main.tscn");
